#include <stdio.h>
#include <stdlib.h>
#include <string.h>

char buf[128]; // Globaler Puffer für Eingaben, wie in 11.2 verwendet.

// Definition der tStud-Struktur, wie in 11.2.
typedef struct {
    char name[30 + 1];
    int matrNr;
    float noteKl;
    int noteBel;
} tStud;

// Funktion zum Anzeigen der Studentendaten, wie in 11.2.
void displayStudent(tStud* s) {
    printf("%-30s, %6d, %3.1f, %d\n",
           s->name,
           s->matrNr,
           s->noteKl,
           s->noteBel);
}

// Funktion zum Erstellen einer neuen Studenten-Struktur, aus 11.3.
// Hier wird der Student sofort in einem eigenen Speicherbereich auf dem Heap erfasst.
tStud* getStudent() {
    // 'malloc' allokiert die Größe einer 'tStud'-Struktur auf dem Heap
    // und gibt einen 'void*'-Pointer zurück, der hier zu 'tStud*' gecastet wird.
    tStud* ps = malloc(sizeof(tStud));

    // Prüfen, ob die Speicherallokation erfolgreich war
    if (ps) {
        printf("%-10s: ", "Name");
        fgets(buf, 32, stdin);
        buf[strlen(buf) - 1] = 0;
        strcpy(ps->name, buf);

        printf("%-10s: ", "MatrikelNr");
        fgets(buf, 32, stdin);
        ps->matrNr = atoi(buf);

        ps->noteKl = 0;
        ps->noteBel = 0;
    }
    // Gibt einen Pointer auf die dynamisch allokierte Struktur zurück (oder NULL bei Fehler)
    return ps;
}

int main(int argc, char** argv) {
    char proceed = 'j';
    // 'pdata' ist ein Pointer auf ein Array von tStud-Pointern auf dem Heap.
    // Es verwaltet Adressen von individuell allokierten tStud-Strukturen, die irgendwo im Speicher liegen können.
    tStud **pdata = NULL;
    // Temporärer Pointer, um den Rückgabewert von realloc für das Pointer-Array zu speichern.
    tStud **ptmp;
    // 'pstud' ist ein Pointer auf eine einzelne tStud-Struktur, die von getStudent zurückgegeben wird.
    tStud *pstud = NULL;

    int count = 0;
    int i;

    do {
        // Ruft getStudent auf, das nun einen Pointer auf eine *neu* auf dem Heap allokierte tStud-Struktur zurückgibt.
        pstud = getStudent();

        // Prüft, ob die Allokation des einzelnen Studenten (mittels malloc in getStudent) erfolgreich war.
        if (pstud) {
            // Dynamische Speicherverwaltung für das *Pointer-Array*:
            // 'realloc' versucht, den Speicherbereich von 'pdata' zu erweitern.
            // Der neue Bereich soll Platz für (count + 1) tStud-Pointer bieten.
            // Wichtig: Hier wird die Größe von 'tStud*' (einem Pointer) multipliziert,
            // nicht die Größe der tStud-Struktur selbst, da wir Pointer speichern.
            ptmp = realloc(pdata, sizeof(tStud*) * (count + 1));

            if (ptmp) {
                // Wenn 'realloc' erfolgreich war, zeigt 'pdata' nun auf den (neuen oder erweiterten) Speicherbereich des Pointer-Arrays.
                pdata = ptmp;
                // Speichert den Pointer zum neu erfassten Studenten im Pointer-Array.
                // Es wird kein tStud-Objekt kopiert, sondern lediglich dessen Adresse in das Array aufgenommen.
                pdata[count] = pstud;
                count++;
            } else {
                // Fehler beim Reallozieren des Pointer-Arrays.
                fprintf(stderr, "Fehler: Speicher für Pointer-Array konnte nicht neu zugewiesen werden.\n");
                // Da 'realloc' für das Pointer-Array fehlschlug, muss der bereits allokierte Student 'pstud' freigegeben werden.
                free(pstud);
                break; // Schleife abbrechen
            }
        } else {
            // Fehler bei der Allokation des einzelnen Studenten in getStudent (malloc in getStudent gab NULL zurück).
            fprintf(stderr, "Fehler: Speicher für neuen Studenten konnte nicht zugewiesen werden.\n");
            break; // Schleife abbrechen
        }

        printf("Weitere Eingabe von Daten (j/n): ");
        fgets(buf, 128, stdin);
        proceed = buf[0];

    } while (proceed == 'j');

    // Alle eingelesenen Studentendaten nacheinander anzeigen
    for (i = 0; i < count; i++) {
        // 'pdata[i]' ist bereits ein Pointer auf eine tStud-Struktur,
        // daher kann er direkt an die Funktion displayStudent übergeben werden.
        displayStudent(pdata[i]);
    }

    // Speicherfreigabe:
    // Bei dieser Implementierung muss die Freigabe in zwei Schritten erfolgen:
    // 1. Zuerst müssen alle individuell allokierten tStud-Strukturen freigegeben werden,
    //    auf die die Pointer im 'pdata'-Array zeigen.
    for (i = 0; i < count; i++) {
        free(pdata[i]);
    }
    // 2. Danach muss das 'pdata'-Array selbst freigegeben werden, das die Pointer gespeichert hat.
    free(pdata);

    return 0;
}
